import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'; // Import the external CSS file

function Header() {
    return (
        <header>
            <nav>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/dashboard">Dashboard</Link>
                    </li>
                    {/* Add more links as needed */}
                </ul>
            </nav>
        </header>
    );
}

export default Header;
